ine them in terms of properties they satisfy, and then based on these definitions develop ways of computing the result of applying the operators and prove them correct. This book is mainly written for computer science students, so here the author takes a different approach: he starts by defining ways of calculating the results of applying the operators and then proves that they satisfy various properties. After justifying his underlying approach the author offers detailed chapters covering propositional logic, predicate calculus, sets, relations, discrete structures, structured types, numbers, and reasoning about programs. The book contains chapter and section summaries, detailed proofs and many end-of-section exercises -- key to the learning process. The book is suitable for undergraduate and graduate students, and although the treatment focuses on areas with frequent applications in computer science, the book is also suitable for students of mathematics and engineering.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9783642298400"},{"type":"ISBN_10","identifier":"3642298400"}],"readingModes":{"text":true,"image":true},"pageCount":296,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"2.7.9.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=kYYJLhL2arwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=kYYJLhL2arwC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=kYYJLhL2arwC&printsec=frontcover&dq=computer+science&hl=&cd=3&source=gbs_api","infoLink":"https://play.google.com/store/books/details?id=kYYJLhL2arwC&source=gbs_api","canonicalVolumeLink":"https://play.google.com/store/books/details?id=kYYJLhL2arwC"},"saleInfo":{"country":"EG","